  true,\n\t\"url\": null,\n\t\"notes\": \"Trace gas fluxes of carbon dioxide, methane,
  nitrous oxide, and nitric oxide were measured manually at undisturbed and logged
  forest sites in the Tapajos National Forest, near Santarem, Para, Brazil. Manual
  measurements were made approximately weekly at both the undisturbed and logged sites.
  Fluxes from clay and sand soils were completed at the undisturbed sites. Fluxes
  were measured at the deck (patio), skid trail, clearing and forest at the logged
  sites. Soil moisture is reported as daily average water-filled pore space (WFPS)
  for the undisturbed forest clay and sand soils. Data are reported in three ASCII
  comma separated files.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
